#import "QNAutomationsViewController.h"
#import "QNAutomationsService.h"
#import "QNAutomationsFlowAssembly.h"
#import "QNActionsHandler.h"
#import "QNAction.h"
#import "Qonversion.h"

#import <WebKit/WebKit.h>
#import <SafariServices/SafariServices.h>

@interface QNAutomationsViewController () <WKNavigationDelegate>

@property (nonatomic, strong) WKWebView *webView;
@property (nonatomic, strong) UIActivityIndicatorView *activityIndicator;

@end

@implementation QNAutomationsViewController

- (void)viewDidLoad {
  [super viewDidLoad];
  
  self.webView = [WKWebView new];
  self.webView.navigationDelegate = self;
  [self.view addSubview:self.webView];
  
  self.activityIndicator = [[UIActivityIndicatorView alloc] initWithActivityIndicatorStyle:UIActivityIndicatorViewStyleWhiteLarge];
  self.activityIndicator.color = [UIColor lightGrayColor];
  self.activityIndicator.hidesWhenStopped = YES;
  [self.view addSubview:self.activityIndicator];
  
  [self loadHTML];
}

- (void)viewDidLayoutSubviews {
  [super viewDidLayoutSubviews];
    
  self.webView.frame = self.view.frame;
}

- (void)loadHTML {
  __block __weak QNAutomationsViewController *weakSelf = self;
  NSString *htmlString = @"<HTML><HEAD><TITLE>{{Your Title Here YOYO}}</TITLE></HEAD><BODY BGCOLOR=\"FFFFFF\"><CENTER><IMG SRC=\"data:image/jpeg;base64,\" ALIGN=\"BOTTOM\"> </CENTER><HR>is a link to another nifty site<H1>This is a Header</H1><H2>This is a Medium Header</H2>Send me mail at <a href=\"qonversion://action?type=navigateTo&data=%7B%22url%22%3A%20%22https%3A%2F%2Fvk.com%26section%3Dprofile%22%7D\">support@yourcompany.com</a>.<P> This is a new paragraph!<P> <B>This is a new paragraph!</B><BR> <B><I>This is a new sentence without a paragraph break, in bold italics.</I></B><HR></BODY></HTML>";
  [weakSelf.webView loadHTMLString:htmlString baseURL:nil];
//  [self.actionsService actionWithID:self.actionID completion:^(NSDictionary *result, NSError * _Nullable error) {
//    [weakSelf.webView loadHTMLString:result[@"id"] baseURL:nil];
//    [weakSelf.activityIndicator stopAnimating];
//  }];
}


#pragma mark - WKNavigationDelegate

- (void)webView:(WKWebView *)webView decidePolicyForNavigationAction:(WKNavigationAction *)navigationAction decisionHandler:(void (^)(WKNavigationActionPolicy))decisionHandler {
  
  BOOL isActionShouldBeHandeled = [self.actionsHandler isActionShouldBeHandled:navigationAction];
  if (!isActionShouldBeHandeled) {
    decisionHandler(WKNavigationActionPolicyAllow);
    return;
  }
  
  decisionHandler(WKNavigationActionPolicyCancel);
  
  QNAction *action = [self.actionsHandler prepareDataForAction:navigationAction];
  
  switch (action.type) {
    case QNActionTypeLink: {
      NSString *urlString = action.value[@"url"];
      if (urlString.length > 0) {
        NSURL *url = [NSURL URLWithString:urlString];
        SFSafariViewController *safariViewController = [[SFSafariViewController alloc] initWithURL:url];
        [self.navigationController pushViewController:safariViewController animated:true];
      }
      break;
    }
    case QNActionTypeDeeplink: {
      NSString *deeplinkString = action.value[@"url"];
      if (deeplinkString.length > 0) {
        NSURL *url = [NSURL URLWithString:deeplinkString];
        [[UIApplication sharedApplication] openURL:url];
      }
      break;
    }
    case QNActionTypeClose:
      [self dismissViewControllerAnimated:YES completion:nil];
      break;
    case QNActionTypePurchase: {
      NSString *productID = action.value[@"product_id"];
      if (productID.length > 0) {
        __block __weak QNAutomationsViewController *weakSelf = self;
        [Qonversion purchase:productID completion:^(NSDictionary<NSString *,QNPermission *> * _Nonnull result, NSError * _Nullable error, BOOL cancelled) {
          [weakSelf.delegate automationsViewController:weakSelf didFinishAutomation:action];
        }];
      }
      break;
    }
    case QNActionTypeRestorePurchases: {
      __block __weak QNAutomationsViewController *weakSelf = self;
      [Qonversion restoreWithCompletion:^(NSDictionary<NSString *,QNPermission *> * _Nonnull result, NSError * _Nullable error) {
        [weakSelf.delegate automationsViewController:weakSelf didFinishAutomation:action];
      }];
      break;
    }
    case QNActionTypeNaivgation: {
      QNAutomationsViewController *viewController = [self.flowAssembly configureAutomationsViewControllerWithID:action.value[@"url"] delegate:self.delegate];
      [self.navigationController pushViewController:viewController animated:YES];
      break;
    }
      
    default:
      break;
  }
}

@end
